import React, { useState } from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";
import Admin from "./Pages/Admin/Admin";
import Posts from "./Pages/Admin/Posts/Posts";
import Ads from "./Pages/Admin/Ads/Ads";
import Categories from "./Pages/Admin/Categories/Categories";
import UpdatePost from "./Pages/Admin/UpdatePost/UpdatePost";
import NewPost from "./Pages/Admin/NewPost/NewPost";
import Home from "./Pages/Home/Home";
import Frontpage from "./Pages/Frontpage/Frontpage";
import CategoryPage from "./Pages/CategoryPage/CategoryPage";
import Search from "./Pages/Search/Search";
import Container from "./Components/Container/Container";
import PrivateRoute from "./Components/PrivateRoute/PrivateRoute";

import "bootstrap/dist/css/bootstrap.min.css";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import "react-datetime/css/react-datetime.css";

export default function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Switch>
          <Route path="/admin/posts/new" component={NewPost} />
          <Route path="/admin/updatepost/:id" component={UpdatePost} />
          <Route path="/admin/posts" component={Posts} />
          <Route path="/admin/categorias" component={Categories} />
          <PrivateRoute path="/admin/ads" component={Ads} />
          <Route exact path="/admin" component={Admin} />
          {/* <Container> */}
          <Switch>
            <Route path="/procurar" component={Search} />
            <Route path="/categories/:category" component={CategoryPage} />
            <Route path="/:frontpage" component={Frontpage} />
            <Route path="/" component={Home} />
          </Switch>
          {/* </Container> */}
        </Switch>
      </Switch>
    </BrowserRouter>
  );
}
